<script type="text/javascript" charset="utf-8" src="cordova.js"></script>
<script>


function envia_post () {
	
	var $login=$("#login").val();
	var $senha=$("#senha").val();
	document.addEventListener("deviceready", onDeviceReady, false);
		
	function onDeviceReady() {
		var $deviceId = device.uuid || 1337;

    $("#carregando").show();
    $.post( "http://appsbdrj.kinghost.net/appsbdrj/recebepost.php", { form: "login", login: $login, senha: $senha, device: $deviceId })
    .done(function( data ) {
      if (data==='AUTORIZADO'){
        window.location.href = "principal.html?logado";
      } else {
          $("#carregando").hide();
          $( "span" ).html( "<center>&nbsp;<br><strong>Usuario ou senha Incorreta!</strong><br>&nbsp;</center>" ).show().fadeOut( 5000 );
      }

    });
  }
}
</script>
